using System;\nusing System.Collections.Generic;\nusing System.Linq;\n\nclass Program\n{\n    static void Main()\n    {\n        var listOfStrings = new List<string> { "C:", "D:", "E:" };\n        string myString1 = @"C:\Files";\n        string myString2 = @"F:\Files";\n\n        bool result1 = listOfStrings.Any(prefix => myString1.StartsWith(prefix));\n        bool result2 = listOfStrings.Any(prefix => myString2.StartsWith(prefix));\n\n        Console.WriteLine(result1); // Output: True\n        Console.WriteLine(result2); // Output: False\n    }\n}